import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import App from "./App";
import reportWebVitals from "./reportWebVitals";

const root = ReactDOM.createRoot(document.getElementById("root"));
const themes = {
  theme1: "Политика",
  theme2: "Регионы",
  theme3: "Инвестиции",
};

root.render(
  <React.StrictMode>
    {
      <App
        themes={themes}
        news={[
          {
            id: 16,
            date: "2023-12-17T12:34:08Z",
            title: "Аэрофлот обещает рост!",
            article_text: "Огромный потенциал компании не был раскрыт!",
            theme: "theme3",
          },
          {
            id: 15,
            date: "2023-12-14T04:17:33Z",
            title: "Инвестиционные возможности на мировых рынках",
            article_text:
              "Эксперты прогнозируют перспективы для инвестиций в различные отрасли на мировых рынках...",
            theme: "theme3",
          },
          {
            id: 14,
            date: "2023-12-14T04:17:13.117Z",
            title: "Успешные кейсы венчурных инвестиций",
            article_text:
              "Несколько успешных стартапов получили значительные инвестиции, продемонстрировав свой потенциал и перспективы...",
            theme: "theme3",
          },
          {
            id: 13,
            date: "2023-12-14T04:16:44.992Z",
            title: "Экономический рост в провинциях",
            article_text:
              "Несколько регионов сообщают о значительном росте экономики и улучшении жизни местных жителей...",
            theme: "theme2",
          },
          {
            id: 12,
            date: "2023-12-14T04:16:28.670Z",
            title: "Интервью с президентом",
            article_text: "Сегодня президент выступил с важным заявлением...",
            theme: "theme1",
          },
          {
            id: 11,
            date: "2023-12-14T04:14:34.883Z",
            title: "Закрытие правительственного саммита",
            article_text:
              "Мировые лидеры собрались на саммите для обсуждения важных вопросов...",
            theme: "theme1",
          },
          {
            id: 10,
            date: "2023-12-14T04:13:56.828Z",
            title: "Новый стартап привлекает крупные инвестиции",
            article_text:
              "Молодая компания, занимающаяся разработкой новых технологий, привлекла крупное финансирование...",
            theme: "theme3",
          },
          {
            id: 7,
            date: "2023-12-14T04:13:37.645Z",
            title: "Природные катастрофы в регионах",
            article_text:
              "Сильные ливни привели к наводнениям в ряде регионов, вызвавших масштабные разрушения...",
            theme: "theme2",
          },
          {
            id: 5,
            date: "2023-12-14T04:13:21.539Z",
            title: "Развитие инфраструктуры в регионах",
            article_text:
              "Новые проекты по развитию инфраструктуры запущены в нескольких регионах страны...",
            theme: "theme2",
          },
          {
            id: 4,
            date: "2023-12-14T04:13:10.627Z",
            title: "Выборы в парламент",
            article_text:
              "Парламентские выборы завершились с ожидаемой победой партии...",
            theme: "theme1",
          },
        ]}
      />
    }
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
